void homing_square(bool* adr_attack_enable, unsigned int* adr_current_frame, unsigned int* adr_attack_start_frame, unsigned int* facing_degree, 
								int heart_x, int heart_y, int* box_x, int* box_y, bool*collision){
	// homing calculations
	
	double dx, dy, quad;
	int angle_b_to_h;
	dx = heart_x - *box_x;
	dy = heart_y - *box_y;
	if(*facing_degree > 360){
		*facing_degree = *facing_degree -360;
	}
    if(dy > 0){
	    if(dx > 0){
			quad = 4;
			angle_b_to_h = 360 - (atan(dy/dx) * (180/PI));
		}
		else if(dx < 0){
			quad = 3;
			angle_b_to_h = 180 + atan(dy/(dx * (-1))) * (180/PI);
		}

	}
	else if(dy < 0){
		if(dx > 0){
			quad = 1;
			angle_b_to_h = atan((dy * (-1))/dx) * (180/PI);
		}
		else if(dx < 0) {
			quad = 2;
			angle_b_to_h = 180 - atan((dy * (-1))/(dx * (-1))) * (180/PI);
		}
	}
	
	if((*facing_degree - angle_b_to_h) > 180){
		*facing_degree = *facing_degree + 5;
	}
	else{
		*facing_degree = *facing_degree - 5;
	}


	//set up phase
	if(!*adr_attack_enable){
		*adr_attack_start_frame = *adr_current_frame;
		*facing_degree = 270;
	}

	else if(*adr_attack_enable){
		unsigned int attack_frame = *adr_current_frame - *adr_attack_start_frame;

		//phase 1 of attack setting initial position
		if(attack_frame <= 50){
			*box_x = 200;
			*box_y = 120;
			draw_box(*box_x, *box_y, 0xf800);
		}
		// phas3 2 attack following heart
		else if(attack_frame < 500){
			if(*facing_degree <= 90){
				*box_x = (3 * cos(*facing_degree*PI/180)) + *box_x;
				*box_y = *box_y - (3 * sin(*facing_degree*PI/180));
			}
			else if(*facing_degree > 90 && *facing_degree <= 180){
				*box_x = *box_x - (3 * cos((180 - (*facing_degree))*PI/180));
				*box_y = *box_y - (3 * sin((180 - (*facing_degree))*PI/180));
			}
			else if(*facing_degree > 180 && *facing_degree <= 270){
				*box_x = *box_x - (3 * cos(((*facing_degree) - 180)*PI/180));
				*box_y = (3 * sin(((*facing_degree) - 180)*PI/180)) + *box_y;
			}
			else if(*facing_degree <= 360){
				*box_x = *box_x + (3 * cos((360 - (*facing_degree))*PI/180));
				*box_y = (3 * sin((360 - (*facing_degree))*PI/180)) + *box_y;
			}


			// fix collision of heart and box as sometimes it shouldnt do damage but it is
			if(heart_x >= (*box_x) &&  heart_x <= (*box_x + 6)){
				if(heart_y -1 >= (*box_y) && heart_y -1 <= (*box_y + 6)){
					*collision = true; 
				}
				else if(heart_y + 3 >= (*box_y) && heart_y+ 5 <= (*box_y + 6)){
					*collision = true; 
				}
				

			}
			if(heart_x + 5 >= (*box_x) &&  heart_x + 5 <= (*box_x + 6)){
				if(heart_y -1 >= (*box_y) && heart_y -1 <= (*box_y + 6)){
					*collision = true; 
				}
				else if(heart_y + 3 >= (*box_y) && heart_y+ 5 <= (*box_y + 6)){
					*collision = true; 
				}
			}

			draw_box(*box_x, *box_y, 0xf800);	
		} else if(attack_frame >= 500){
			*adr_attack_enable = false;
			*adr_attack_start_frame = *adr_current_frame;
			attack_frame = 0;
			angle_b_to_h = 0;
			*facing_degree = 270;
		}	
	}
	
}
void falling_blocks(bool* adr_attack_enable, unsigned int* adr_current_frame, 
					unsigned int* adr_attack_start_frame, struct falling_rain* falling_attack_array, 
					int heart_x, int heart_y, bool*collision){
	if(*adr_attack_enable == false){
		*adr_attack_start_frame = *adr_current_frame;
		for(int it = 0; it < 20; it++){
				falling_attack_array[it].xpos = 0;
				falling_attack_array[it].ypos = 0;
				falling_attack_array[it].exists = true; 
			}
	}
	else{
		int attack_frames = *adr_current_frame - *adr_attack_start_frame;
		bool all_false = true;
		for(int it = 0; it<attack_frames && it < 20; it++){
			if(falling_attack_array[it].exists && falling_attack_array[it].xpos == 0 && falling_attack_array[it].ypos == 0 ){
				falling_attack_array[it].ypos = 130;
				falling_attack_array[it].xpos = (rand()%(205-125)) +125;
			}
			else if(falling_attack_array[it].exists){
				plot_pixel(falling_attack_array[it].xpos, falling_attack_array[it].ypos, 0xf800);
				falling_attack_array[it].ypos++;
			}
			if(falling_attack_array[it].ypos > 210){
				falling_attack_array[it].exists = false;
			}
		}
		for(int it =0; it < 20; it++){
			if(falling_attack_array[it].exists){
				all_false = false;
			}
		}
		if(all_false){
			*adr_attack_enable = false;
			for(int it = 0; it < 20; it++){
				falling_attack_array[it].xpos = 0;
				falling_attack_array[it].ypos = 0;
				falling_attack_array[it].exists = true; 
				*adr_attack_start_frame = *adr_current_frame;
			}
		}
		for(int it = 0; it < 20; it++){
			if(falling_attack_array[it].xpos  >= heart_x &&  falling_attack_array[it].xpos  <= (heart_x + 5)){
					if((falling_attack_array[it].ypos  >= (heart_y -1) &&  falling_attack_array[it].ypos  <= (heart_y + 3))){
						*collision = true; 
					}
			}
		}
	}
}


