char keyboard_input_poll(){
    int ps2_data; 
    volatile int*ps2_ptr = (int*) PS2_data; 

    do{
        ps2_data = *ps2_ptr; 
    } while (!(ps2_data & 0x8000)); // wait till bit 15 is set

    return ps2_data & 0xFF; //mask last two bits for keyboard data
}

